import React, { Component } from "react";
import "./App.css";
import { Button } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <ButtonGroup>
        <Button variant="outline-primary" size="lg">
          +
        </Button>
        <Button variant="outline-danger" size="lg">
          -
        </Button>
      </ButtonGroup>
    </div>
  );
}

export default App;
